import React, { Component } from "react";
import Layout from "../../components/Layout";
import Game from "../../components/Game";

class Theresume extends Component{
    render(){
        return(
            <Layout>
                <script src="/components/theresume/Build/UnityLoader.js"></script>
                <script>
                    UnityLoader.instantiate("unityContainer", "/components/theresume/Build/Build/Game.json");
                </script>
                <div className="container">
                    <div className="row d-flex justify-content-center">
                        <h1>The Resume Game</h1>
                        <Game />
                    </div>
                </div>                 
            </Layout>               
        )
    }
}

export default Theresume;
